import { useState,useEffect } from "react";
import axios from "axios"


function Prova() {


    const [lista,setLista]=useState();

    useEffect( ()=>{
  
      axios.get("http://localhost:8080/ExoBankRest/rest/utenteRest/findAll2").then( (response) =>{
            setLista(response.data)
            console.log("response")
            console.log(response)
            console.log("response data")
            console.log(response.data)
      } )
      },[]  )
      
  
      return (
      
        <>
        
        <h1>CIAO</h1>
  
  
        <div style={ {width:200,height:200,backgroundColor:"white"} }>
            {Array.isArray(lista) ? (
          lista.map( (e) => (
            
            
                <div className="post"key={e.id} >
                    <p><b>ID</b></p>
                  <p><b>{e.id}</b></p>
                  <p><b>NOME</b></p>
                  <p><b>{e.nome}</b></p>   
                  <p><b>COGNOME</b></p>
                  <p><b>{e.cognome}</b></p>
                  <p><b>EMAIL</b></p>
                  <p><b>{e.email}</b></p>  
                  <p><b>PASSWORD</b></p>
                  <p><b>{e.password}</b></p>
                  <p><b>ID RUOLO</b></p>
                  <p><b>{e.ruolo.id}</b></p>  
                  <p><b>TIPO RUOLO</b></p>
                  <p><b>{e.ruolo.tipo_ruolo}</b></p>  
                
                </div>
              
           
          ))
        ) : (
          <p>Non ci sono utenti</p>
        )}
    </div>
        </>
      );









}export default Prova;
